Each smallweb installation comes with a built-in REST API. You can map it to a subdomain by creating a smallweb.json manifest: // ~/smallweb/api/smallweb.jsonc
{ "entrypoint": "smallweb:api", // make sure to protect your API "private": true, "publicRoutes": [ // openapi manifest "/openapi.json", // json schemas for config files "/schemas/*" ]
} A swagger UI is available at the root of the api, allowing you to easily test the available endpoints.

