Since the API is based on OpenAPI, you can easily generate client libraries for your favorite language. For usage in smallweb apps, I personally recommend using feTS . Here is an example of how you can use it (no code-gen required): import { createClient, type NormalizeOAS } from 'npm:fets'
import type openapi from 'jsr:@smallweb/openapi@<smallweb-version>' const client = createClient<NormalizeOAS<typeof openapi>>({ endpoint: Deno.env.get("SMALLWEB_API_URL"), globalParams: { headers: { Authorization: `Bearer ${Deno.env.get("SMALLWEB_API_TOKEN")}` } }
}) const res = await client['/v0/apps'].get()
if (!res.ok) { throw new Error(`Failed to fetch apps: ${res.statusText}`)
} const apps = await res.json() // typed!

